import React from 'react';

function Navbar() {

	return (

		/* NAVBAR */
		<nav id="navbar" className="navbar sticky-top navbar-expand-lg">
			<div className="container-fluid">

				<a className="navbar-brand" href="#">
					<img src="logo-white-noBG-200px.png" alt="" width="50" height="50" style={{ marginRight: "10px" }}></img>
					MARTEN
				</a>

			</div>
		</nav>
	);

};

export default Navbar;
